import { getTimeDate } from "@/utils/index.js";
import ShopInfo from "./shopinfodialog";
import Qs from "qs"; // 1，未完善资料，2、已提交资料，待平台审核，3、审核中，4、审核通过，5、审核失败，6、正常，7、锁定，8，黑名单

export default {
  components: {
    ShopInfo: ShopInfo
  },
  filters: {
    statusFilter: function statusFilter(status) {
      var statusMap = {
        1: "info",
        2: "gray",
        3: "gray",
        4: "success",
        5: "danger",
        6: "success",
        7: "danger",
        8: "danger"
      };
      return statusMap[status];
    }
  },
  data: function data() {
    return {
      currentPage: 1,
      pageSize: 10,
      total: 0,
      dialogTableVisible: false,
      selectTaskData: {},
      list: null,
      listLoading: true,
      form: {
        businessStatusId: "",
        starttime: "",
        endtime: "",
        _uiName_: "eleme"
      }
    };
  },
  created: function created() {},
  computed: {},
  mounted: function mounted() {
    this.fetchData();
  },
  methods: {
    formatTime: function formatTime(row, column, cellValue) {
      return getTimeDate(cellValue);
    },
    resetForm: function resetForm(formName) {
      this.form.businessStatusId = "";
      this.form.starttime = this.form.endtime = "";
    },
    //获取用户列表
    fetchData: function fetchData() {
      var _this = this;

      var page = {
        pageNumber: this.currentPage,
        pageSize: this.pageSize
      };
      this.form["_pagination"] = JSON.stringify(page);
      this.listLoading = true;
      this.axios.get(this.urls.getbusinesslist + "?" + Qs.stringify(this.form)).then(function (response) {
        if (response.data.errcode == 0) return _this.$message.error(response.data.errmsg);
        _this.list = response.data.list;
        _this.total = response.data.totalRow;
        _this.listLoading = false;
      });
    },
    operationHandle: function operationHandle(index, row, type) {
      var _this2 = this;

      this.$confirm("是否确认执行此操作?", "提示", {
        confirmButtonText: "确定",
        cancelButtonText: "取消",
        type: "warning"
      }).then(function () {
        var param = {
          businessId: row.id,
          businessStatusId: type
        };

        switch (type) {
          case 5:
            _this2.operationRemote(_this2.urls.businessstatus, param); //拒绝


            break;

          case 6:
            _this2.operationRemote(_this2.urls.businessstatus, param); //通过


            break;

          case 7:
            _this2.operationRemote(_this2.urls.businessstatus, param); //拉黑


            break;

          default:
            break;
        }
      });
    },
    operationRemote: function operationRemote(url, param) {
      var _this3 = this;

      this.axios.put(url + "?" + Qs.stringify(param)).then(function (response) {
        _this3.fetchData();
      });
    },
    lookinfo: function lookinfo(index, row) {
      this.dialogTableVisible = true;
      this.selectTaskData = row;
    },
    editDialogListener: function editDialogListener(bol) {
      this.dialogTableVisible = bol;
    },
    setBasePrice: function setBasePrice(index, row) {
      var _this4 = this;

      this.$prompt("请输入协商好的拥挤折扣", "提示", {
        confirmButtonText: "确定",
        cancelButtonText: "取消",
        inputPattern: /^\+?[1-9]\d*$/,
        inputErrorMessage: "请输入有效数字"
      }).then(function (_ref) {
        var value = _ref.value;
        var param = {
          id: row.id,
          name: row.name,
          trueName: row.trueName,
          idCard: row.idCard,
          address: row.address,
          contact1: row.contact1,
          contact2: row.contact2,
          contact3: row.contact3,
          wechat: row.wechat,
          qq: row.qq,
          basePrice: value,
          files: row.files
        };

        _this4.axios.put(_this4.urls.editinfo + "?" + Qs.stringify(param)).then(function (response) {
          if (response.code == 0) return _this4.$message.error(response.msg);

          _this4.$message({
            message: "操作成功",
            type: "success"
          });

          _this4.fetchData();
        });
      }).catch(function () {});
    },
    handleSizeChange: function handleSizeChange(val) {
      this.pageSize = val;
      this.fetchData();
    },
    handleCurrentChange: function handleCurrentChange(val) {
      this.currentPage = val;
      this.fetchData();
    }
  }
};
